CREATE VIEW reporte AS
SELECT N.ID, N.COMENTARIO, N.FECHA_REGISTRO, U.NOMBRE, U.EMPRESA, U.CARGO, 
E.NOMBRE_EMPRESA, E.NOMBRE_EXPOSITOR 
FROM NOTA as N, USUARIO as U, EXPOSITOR as E 
WHERE N.ID_EXPOSITOR = E.ID AND N.ID = U.ID;


